  [],\n\t\"num_tags\": 3,\n\t\"name\": \"hybrid-element-method-for-compsoite-structures-subjected-to-boundary-layer-loading-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In many situations, aerospace structures
  are subjected to a wide frequency spectrum of mechanical and/or acoustic excitations
  and therefore, there is a need for the development of numerical modeling techniques
  that are applicable for the resolution of dynamic response of complex systems spanning
  the entire frequency spectrum. Further, the modeling of composite structures becomes
  more and more important since many new vehicle designs incorporate increased amount
  of composite structural components due to weight specific advantages of composites.
  Thus, we propose to develop techniques that will allow the prediction of noise in
  the interior of an enclosure such as aircraft due to the transmission of turbulent
  boundary layer loading in the presence of composite structural components. This
  innovative Hybrid Element Method (HEM) solution tool for mid-frequency analysis,
  which utilizes elements of DEA, together with conventional low frequency FEM tools
  and high frequency EFEM tools, will provide a unified framework that is applicable
  for the solution of full frequency spectrum vibroacoustic prediction of nonuniform
  aerospace structures including metallic/composite configurations, accurately and
  efficiently. \",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
